sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if (inputs.response_status == '200'){
 var responseObj = JSON.parse(inputs.response_body);

   outputs.id = responseObj.character_list[0].id;
   outputs.race = responseObj.character_list[0].type.race;
   outputs.deity = responseObj.character_list[0].type.deity;
   outputs.class = responseObj.character_list[0].type.class;
   outputs.level = responseObj.character_list[0].type.level;
   outputs.server = responseObj.character_list[0].locationdata.world;
   outputs.portrait = "http://census.daybreakgames.com/img/eq2/character/" + responseObj.character_list[0].id + "/paperdoll";


}else{
 gs.info("Everquest2 get character failed: Code " + inputs.response_error_code + " Message: " + inputs.response.error_message);
}
})(inputs, outputs);

